import React from "react";
import {
  ContactContainer,
  LinkContainer,
  IconContainer,
} from "./Contact.style";

const Contact = () => {
  return (
    <ContactContainer>
      <LinkContainer>
        <IconContainer>
          <i class="fab fa-facebook-f"></i>
        </IconContainer>
        <span>Facebook</span>
      </LinkContainer>
      <LinkContainer>
        <IconContainer>
          <i class="fab fa-github"></i>
        </IconContainer>
        <span>Github</span>
      </LinkContainer>
      <LinkContainer>
        <IconContainer>
          <i class="fab fa-linkedin-in"></i>
        </IconContainer>
        <span>LinkedIN</span>
      </LinkContainer>
    </ContactContainer>
  );
};
export default Contact;
